import React, { useState } from "react";
import axios from 'axios';
import { useNavigate } from "react-router-dom";
import './RegisterPage.css'; // Import custom CSS file for styling

export default function RegisterPage(){

    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate();
     
    const registerUser = () => {
        axios.post('http://127.0.0.1:5000/signup', {
            email: email,
            password: password
        })
        .then(function (response) {
             console.log(response);
            navigate("/");
        })
        .catch(function (error) {
            console.log(error, 'error');
            if (error.response.status === 401) {
                alert("Invalid credentials");
            }
        });
    };
     
    let imgs = [
      '',
    ];

    return (
        <div>
            <div className="container h-100">
            <img src="/kidneys.jpeg" alt="Kidneys" className="landing-image" />
                <div className="container-fluid h-custom">
                    <div className="row d-flex justify-content-center align-items-center h-100">
                        <div className="col-md-8 col-lg-6 col-xl-4 offset-xl-1 login-form">
                            <form>
                                <div className="d-flex flex-row align-items-center justify-content-center justify-content-lg-start">
                                    <p className="lead fw-normal mb-0 me-3 form-title">Create Your Account</p>
                                </div>

                                <div className="form-outline mb-4 form-group">
                                <label className="form-label" htmlFor="form3Example3">Email address</label>
                                    <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} id="form3Example3" className="form-control form-control-lg" placeholder="Enter a valid email address" />
                                    
                                </div>

                                <div className="form-outline mb-3 form-group">
                                <label className="form-label" htmlFor="form3Example4">Password</label>
                                    <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} id="form3Example4" className="form-control form-control-lg" placeholder="Enter password" />
                                   
                                </div>

                                <div className="d-flex justify-content-between align-items-center form-group">
                                    <div className="form-check mb-0">
                                        <input className="form-check-input me-2" type="checkbox" value="" id="form2Example3" />
                                        <label className="form-check-label" htmlFor="form2Example3">
                                            Remember me
                                        </label>
                                    </div>
                                    <a href="#!" className="text-body forgot-password">Forgot password?</a>
                                </div>

                                <div className="text-center text-lg-start mt-4 pt-2">
                                    <button type="button" className="btn btn-primary btn-lg" onClick={registerUser}>Sign Up</button>
                                    <p className="small fw-bold mt-2 pt-1 mb-0 register-link">Login to your account <a href="/login" className="link-danger">Login</a></p>
                                </div>

                            </form>
                        </div>
                        <div className="col-md-9 col-lg-6 col-xl-5">
                            <img src={imgs[0]} className="img-fluid" />
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
